import React from 'react';
import Sdata from './Sdata';
import { useState } from 'react';

const App = () => {
  const [img, setimg] = useState('');
  const inputEvent = (event) => {
    const data = event.target.value;
    setimg(data);
    console.log(img);
  };
  return (
    <div>
      <input
        type='text'
        placeholder='Search..'
        onChange={inputEvent}
        value={img}
      />
      <Sdata name={img} />
    </div>
  );
};

export default App;
